import React from "react";
import {Algorithm} from "./algorithms/algorithm_interface";
import {useParams} from "react-router-dom";

import {MinHeap} from "./algorithms/min_heap";

const Animator: React.FC = () => {

    const {algorithmType} = useParams<{algorithmType: string}>();

    let algorithm: Algorithm | null = null;

    RetrieveAlgorithm(algorithmType);

    return (
        <div>
            <h1>Algorithm Animator</h1>
            {algorithm.display()}
        </div>
    );
};

const RetrieveAlgorithm = (algorithmName : string): Algorithm | null => {

    if (algorithmName === "min-heap") {
        return new MinHeap();
    }

    return null;
}

export default Animator;
